import React from 'react';

import { withFirebase } from '../components/Firebase/context';
import { withRouter } from 'react-router-dom';

import {
  Switch,
  Route,
  useRouteMatch
} from "react-router-dom";

import clsx from 'clsx';
import CssBaseline from '@material-ui/core/CssBaseline';
import Box from '@material-ui/core/Box';
import AppBar from '@material-ui/core/AppBar';
import Toolbar from '@material-ui/core/Toolbar';
import Typography from '@material-ui/core/Typography';
import IconButton from '@material-ui/core/IconButton';
import Badge from '@material-ui/core/Badge';
import Container from '@material-ui/core/Container';
import MenuIcon from '@material-ui/icons/Menu';
import NotificationsIcon from '@material-ui/icons/Notifications';

import useStyles from '../config/theme.dashboard';
import Copyright from '../components/CopyRight/copyright';
import Sidebar from '../components/Sidebar/index'

function Dashboard(props) {
  let match = useRouteMatch();

  const classes = useStyles();
  const [open, setOpen] = React.useState(true);
  const handleDrawerOpen = () => {
    setOpen(true);
  };
  const handleDrawerClose = () => {
    setOpen(false);
  };

  const signOut = () => {
    props.firebase.auth.signOut()
    props.history.push("/");
  }


  return (
    <div className={classes.root}>
      <CssBaseline />
      <AppBar position="absolute" className={clsx(classes.appBar, open && classes.appBarShift)}>
        <Toolbar className={classes.toolbar}>
          <IconButton
            edge="start"
            color="inherit"
            aria-label="open drawer"
            onClick={handleDrawerOpen}
            className={clsx(classes.menuButton, open && classes.menuButtonHidden)}
          >
            <MenuIcon />
          </IconButton>
          <Typography component="h1" variant="h6" color="inherit" noWrap className={classes.title}>
            Dashboard
                </Typography>
          <IconButton color="inherit">
            <Badge badgeContent={4} color="secondary">
              <Typography component="p" style={{ paddingRight: "15px" }}>
                username
                    </Typography>
              <NotificationsIcon />
            </Badge>
          </IconButton>
        </Toolbar>
      </AppBar>

      <Sidebar signOut={signOut} open={open} handleDrawerClose={handleDrawerClose} />

      <main className={classes.content, !open ? classes.contentClosed : classes.appBarShift}>
        <div className={classes.appBarSpacer} />
        <Container maxWidth="xl" className={classes.container}>
          Calendar
                <Box pt={4}>
            <Copyright />
          </Box>
        </Container>
      </main>

    </div>
  );
};

export default withRouter(withFirebase(Dashboard));
